script: |
  super -f text -I q3255.spq | sort > q3255.out

inputs:
  - name: q3255.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - col1 - col1 * - col0 NOT BETWEEN - cor0.col2 + col1 AND NULL OR - col2 + + col2 * col1 NOT BETWEEN NULL AND + col1 - col0;
  - name: tab1

outputs:
  - name: q3255.out
    data: |
      3	26	54
      64	10	57
      80	13	96
